                <p class=""description""> 
                    Résolument tourné vers le monde professionnel (IMF, Banques, ONG et autres institutions financières spécialisées), ce programme est unique
                    dans son contenu et dans son articulation. Il permet d’acquérir toutes les compétences qu’il est nécessaire de maîtriser pour être opérationnel dans
                    le secteur de la microfinance, de la banque et de la finance.
